DROP DATABASE IF EXISTS covid19;
CREATE DATABASE covid19;
USE covid19; 

CREATE TABLE mytable(
   reportDate     DATE NOT NULL,
   Hospital       VARCHAR(16) NOT NULL,
   DPHCategory    VARCHAR(8) NOT NULL,
   CovidStatus    VARCHAR(6) NOT NULL,
   PatientCount   INTEGER  NOT NULL,
   data_loaded_at VARCHAR(22) NOT NULL
);
